import React from 'react';
import Styled from 'styled-components';
import { InnerLayout } from '../../styles/Layout';
import History from './History';

function ViewT() {
  return (
    <ViewTStyled>
      <InnerLayout>
        <h1>Transaction History</h1>
        <History />
      </InnerLayout>
    </ViewTStyled>
  );
}

const ViewTStyled = Styled.div``;

export default ViewT;
